  background: rgba(44, 44, 44, .7);
  position: absolute;
  top: -10px;
  left: 0px;
  right: 0px;
  min-height: 15px;
  display: block;
  opacity: 0;
  color: #AAA;
}

.c-DashMonitor.isVisible {
  transition: opacity .2s linear, top .25s ease-out;
  top: 0px;
  opacity: 1;
}

.c-DashMonitor .streamData,
.c-DashMonitor .key
{
  display: none;
}

.c-DashMonitor .isVisible {
  display: block;
}

.c-DashMonitor .streamMetrics {
  list-style-type: none;
  padding: 5px 5px 0 5px;
  margin: 0;
}

.c-DashMonitor .streamMetrics li {
  margin-right: 5px;
  margin-bottom: 5px;
  border: 1px solid rgba(255, 255, 255, 0.5);
  background: #313131;
  overflow: hidden;
  vertical-align: top;
  font-size: 11px;
  display: none;
}

.c-DashMonitor .streamMetrics li.hasValue {
  display: inline-block;
}

.c-DashMonitor .streamTitle {
  font-size: 15px;
  display: inline-block;
  width: 80px;
  text-align: right;
  float: left;
  margin-right: 5px;
  line-height: 30px;
}

.c-DashMonitor .metricTitle {

  padding: 3px 5px;
  display: inline-block;
  font-weight: bold;
}

.c-DashMonitor .metricValue {
  display: inline-block;
  padding: 3px 5px;
  white-space: nowrap;
  background: rgb(95, 95, 95);
  color: white;
}


.c-DashMonitor .row {
  line-height: 15px;
  height: 15px;
  padding-bttom: 1px;
  position: relative;
  border-top: 1px solid rgba(255, 255, 255, 0.1);
  border-bottom: 1px solid rgba(255, 255, 255, 0.1);
  margin-top: -1px;
  font-family: Segoe UI;
  font-weight: bold;
  font-size: 9px;
  background: #222;
}

.c-DashMonitor .traffic {
  position: relative;
}

.c-DashMonitor .seekContainer {
  margin-left: 3px;
}
.c-DashMonitor .seekBar {
  position: absolute;
  top: 0;
  left: 0%;
  width: 2px;
  margin-left: -2px;
  background: rgba(255,255,255,.7);
  height: 100%;
}

.c-DashMonitor .rowHeader {
  position: absolute;
  width: 80px;
  text-align: right;
}

.c-DashMonitor .rowFragments,
.c-DashMonitor .seekContainer {
  position: absolute;
  top: 0;
  left: 85px;
  right: 0;
  bottom: 0;
}

.c-DashMonitor .rowRequest {
  position: absolute;
  top: 2px;
  bottom: 2px;
  border-radius: 4px;
  box-shadow: inset -4px 0px 7px 0px rgba(0,0,0,.6);
  min-width: 5px;
}

.c-DashMonitor .key {
  box-shadow: inset 0 8px 15px -10px rgba(0,0,0,.2);
  font-size: 11px;
  padding: 10px;
}


.c-DashMonitor .keyItem {
  display: inline-block;
  margin-right: 10px;
}

.c-DashMonitor .keyBox {
  display: inline-block;
  position: relative;
  top: -1px;
  width: 10px;
  height: 10px;
  margin: 0 5px;
  border: 1px solid #888;
  vertical-align: middle;
}

.c-DashMonitor .waiting { background: rgb(173, 173, 173) url(data:image/gif;base64,R0lGODlhBAAEAIAAANLS0paWliH/C05FVFNDQVBFMi4wAwEAAAAh+QQEBQAAACwAAAAABAAEAAACBkwAl2h5BQAh+QQEBQAAACwAAAAABAAEAAACBURiaLBZACH5BAQFAAAALAAAAAAEAAQAAAIGBBKXaHkFACH5BAQFAAAALAAAAAAEAAQAAAIFDGBosVkAOw==); }
.c-DashMonitor .downloading { background: rgb(114, 114, 114) url(data:image/gif;base64,R0lGODlhBAAEAIAAADZn96m++yH/C05FVFNDQVBFMi4wAwEAAAAh+QQEBQAAACwAAAAABAAEAAACBgQSl2h5BQAh+QQEBQAAACwAAAAABAAEAAACBQxgaLFZACH5BAQFAAAALAAAAAAEAAQAAAIGTACXaHkFACH5BAQFAAAALAAAAAAEAAQAAAIFRGJosFkAOw==); }
.c-DashMonitor .downloaded { background: rgb(55, 71, 255); }
.c-DashMonitor .appending { background: rgb(133, 185, 143); }
.c-DashMonitor .appended { background: rgb(0, 189, 36); }
.c-DashMonitor .error { background: rgb(223, 66, 66); }
